            var strategy = input.Split("\r\n");

            var rock = 1; // a
            var paper = 2; // b
            var scissors = 3; // c
            var lose = 0; // x
            var draw = 3; // y
            var win = 6; // z

            var totalScore = 0;

            foreach (var game in strategy)
            {
                var moves = game.Split(" ");
                if (string.IsNullOrWhiteSpace(moves[0]) || string.IsNullOrWhiteSpace(moves[1]))
                    continue;

                // win
                if (moves[1].Equals("Z"))
                {
                    // rock -- paper
                    if (moves[0].Equals("A"))
                        totalScore += (win + paper);
                    // paper -- scissors
                    else if (moves[0].Equals("B"))
                        totalScore += (win + scissors);
                    // scissors -- rock
                    else if (moves[0].Equals("C"))
                        totalScore += (win + rock);
                }
                // draw
                else if (moves[1].Equals("Y"))
                {
                    // rock -- rock
                    if (moves[0].Equals("A"))
                        totalScore += (draw + rock);
                    // paper -- paper
                    else if (moves[0].Equals("B"))
                        totalScore += (draw + paper);
                    // scissors -- scissors
                    else if (moves[0].Equals("C"))
                        totalScore += (draw + scissors);
                }
                // lose
                else if (moves[1].Equals("X"))
                {
                    // rock -- scissors
                    if (moves[0].Equals("A"))
                        totalScore += (lose + scissors);
                    // paper -- rock
                    else if (moves[0].Equals("B"))
                        totalScore += (lose + rock);
                    // scissors -- paper
                    else if (moves[0].Equals("C"))
                        totalScore += (lose + paper);
                }
            }

            Console.WriteLine(totalScore);
        }
